import React, { Component } from 'react';
import "material-components-web/dist/material-components-web.min.css";
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';

const classes = theme => ({
    root: {
        flexGrow: 1,
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
    },
});

class UpcomingLaunches extends Component {

    constructor(props) {
        super(props);
        this.state = {
            UpcomingLaunches: [],
            isFetching: true
        }
    }

    componentDidMount() {
        fetch("https://api.spacexdata.com/v3/launches/upcoming")
            .then(res => res.json())
            .then((findresponse) => {
                try {
                    this.setState({
                        UpcomingLaunches: findresponse
                    })
                } catch (err) {
                    console.log(err);
                }
                console.log("response of launches", this.state.UpcomingLaunches);
            })
            .catch((err) => {
                console.log({ status: 500, message: 'Internal Server Error', err });
            })
    }

    render() {
        const { classes } = this.props;
        const { isFetching } = this.state;
        let displaydata;
        console.log("upcoming launches", this.state.UpcomingLaunches);

        if (!isFetching && this.state.UpcomingLaunches)
        displaydata = this.state.UpcomingLaunches.map(spacedata =>
           <div>
           <Grid container spacing={3}>
                <Grid item xs={6}>

                        <div>{spacedata.flight_number}</div>

                </Grid>
            </Grid>
            </div>
        )

        return (
            <div className={classes.root}>
                <h2>Upcoming Launches</h2>
                <div>
                    <div>
                    {displaydata}
                    </div>
                </div>
            </div>
        )
    }
}
UpcomingLaunches.propTypes = {
    container: PropTypes.object,
};

export default withStyles(classes)(UpcomingLaunches);
